import React, {useState, useEffect} from 'react'
import TrackCard from '../components/TrackCard'

// 模拟的音乐数据
const mockTracks = {
  happy: [
    {
      id: '1',
      name: 'Happy Song',
      artists: [{name: 'Joy Band'}],
      album: {
        images: [{url: 'https://uk.pinterest.com/pin/815573814585173989/'}]
      },
      preview_url: null
    },
    {
      id: '2',
      name: 'Sunshine Day',
      artists: [{name: 'Bright Stars'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/FFA500/000000?text=Sun'}]
      },
      preview_url: null
    },
    {
      id: '3',
      name: 'Good Vibes',
      artists: [{name: 'Happy Team'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/FFFF00/000000?text=Vibes'}]
      },
      preview_url: null
    }
  ],
  sad: [
    {
      id: '4',
      name: 'Rainy Day',
      artists: [{name: 'Blue Soul'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/4169E1/FFFFFF?text=Rain'}]
      },
      preview_url: null
    },
    {
      id: '5',
      name: 'Lonely Night',
      artists: [{name: 'Silent Echo'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/191970/FFFFFF?text=Night'}]
      },
      preview_url: null
    }
  ],
  energetic: [
    {
      id: '6',
      name: 'Power Up',
      artists: [{name: 'Energy Boost'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/FF0000/FFFFFF?text=Power'}]
      },
      preview_url: null
    },
    {
      id: '7',
      name: 'High Speed',
      artists: [{name: 'Fast Lane'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/FF4500/FFFFFF?text=Speed'}]
      },
      preview_url: null
    }
  ],
  relaxed: [
    {
      id: '8',
      name: 'Calm Waters',
      artists: [{name: 'Peaceful Mind'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/87CEEB/000000?text=Calm'}]
      },
      preview_url: null
    },
    {
      id: '9',
      name: 'Soft Breeze',
      artists: [{name: 'Zen Garden'}],
      album: {
        images: [{url: 'https://via.placeholder.com/300/98FB98/000000?text=Breeze'}]
      },
      preview_url: null
    }
  ]
}

const PlaylistPage = ({selectedMood, favorites, setFavorites}) => {
  const [tracks, setTracks] = useState([])
  const [loading, setLoading] = useState(false)

  useEffect(() => {
    if (selectedMood) {
      fetchTracks()
    }
  }, [selectedMood])

  const fetchTracks = async () => {
    setLoading(true)

    // 模拟 API 加载延迟
    setTimeout(() => {
      // 根据心情获取对应的歌曲
      const moodKey = selectedMood.mood.toLowerCase()
      const mockData = mockTracks[moodKey] || mockTracks.happy

      console.log('Tracks loaded:', mockData.length)
      setTracks(mockData)
      setLoading(false)
    }, 1000) // 1秒延迟，模拟真实API
  }

  const handleFavorite = (track) => {
    const isFavorite = favorites.find(fav => fav.id === track.id)

    if (isFavorite) {
      setFavorites(favorites.filter(fav => fav.id !== track.id))
    } else {
      setFavorites([...favorites, track])
    }
  }

  if (!selectedMood) {
    return (
      <div className="min-h-screen bg-gray-50 p-8">
        <div className="max-w-4xl mx-auto text-center">
          <h2 className="text-3xl font-bold text-gray-800 mb-4">
            No mood selected
          </h2>
          <p className="text-gray-600">
            Please go to home page and select your mood
          </p>
        </div>
      </div>
    )
  }

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <div className="max-w-4xl mx-auto">
        <h1 className="text-4xl font-bold text-gray-800 mb-2">
          {selectedMood.mood} Playlist
        </h1>
        <p className="text-gray-600 mb-8">
          Perfect songs for your current mood
        </p>

        {loading ? (
          <div className="text-center py-12">
            <div className="text-4xl mb-4 animate-pulse">🎵</div>
            <p className="text-gray-600">Loading your playlist...</p>
          </div>
        ) : (
          <div className="space-y-4">
            {tracks.length === 0 ? (
              <div className="text-center py-12">
                <p className="text-gray-600">No tracks found</p>
                <button
                  onClick={fetchTracks}
                  className="mt-4 bg-blue-500 text-white px-6 py-2 rounded-lg hover:bg-blue-600"
                >
                  Try Again
                </button>
              </div>
            ) : (
              tracks.map((track) => (
                <TrackCard
                  key={track.id}
                  track={track}
                  onFavorite={handleFavorite}
                  isFavorite={favorites.some(fav => fav.id === track.id)}
                />
              ))
            )}
          </div>
        )}
      </div>
    </div>
  )
}

export default PlaylistPage
